insert into SERVICO values ('','Serviço Móvel Pessoal',1,'É o serviço que permite a comunicação entre celulares ou entre um celular e um telefone fixo. Pela Resolução Tecnicamente, é definido como o serviço de telecomunicações móvel terrestre de interesse coletivo que possibilita a comunicação entre estações móveis e de estações móveis para outras estações.');
