insert into SERVICO values ('','Serviço Telefônico Fixo Comutado',1,'É o serviço de telecomunicações que, por meio da transmissão de voz e de outros sinais, destina-se à comunicação entre pontos fixos determinados, utilizando processos de telefonia. Entre as modalidades de telefonia fixa para o público em geral estão o serviço Local, o serviço de Longa Distância Nacional (LDN) e o serviço de Longa Distância Internacional (LDI).');
