insert into SERVICO values ('','Serviço Móvel Especializado',1,'É o serviço que possibilita a comunicação por meio de despacho via radiocomunicação para uma pessoa ou grupos de pessoas previamente definidos. Semelhante ao celular, é tecnicamente definido como o serviço de telecomunicações móvel terrestre de interesse coletivo que utiliza sistema de radiocomunicação, basicamente, para a realização de operações tipo despacho e outras formas de telecomunicações.');
