insert into SERVICO values ('','Serviço Especial de Radiochamada',1,'Conhecido como bip ou paging, é o serviço que permite o envio de informação/recado de uma central para outro ponto. Tecnicamente é definido como serviço especial de telecomunicações, não aberto à correspondência pública, com características específicas, destinado a transmitir, por qualquer forma de telecomunicação, informações unidirecionais originadas em uma estação de base e endereçadas a receptores móveis, utilizando-se das faixas de radiofreqüências de 929 MHz e 931 MHz.');
